import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    alignSelf: 'flex-start',
    borderRadius: 10,
    margin: 25,
    backgroundColor: 'white',
    minWidth: 50,
  },
  text: {
    fontSize: 20,
    padding: 10,
    textAlign: 'center',
  },
});

export default styles;
